Top Fighter 2 aka Deadly Fighting Dolls (Cynthia Rothrock, 1996) - DVD/Rmvb

Plot: &quot;Top Fighter 2&quot; is a spectacular look at the female superstars of martial arts cinema. Over 20 of the toughest battling babes are featured, including Angela Mao, Moon Lee, Elaine Lui, Yukari Oshima, Michiko, and Michelle Yeoh. 

Overview: From the producers of the highly acclaimed &quot;Top Fighter&quot; Comes the action-packed sequel, &quot;Top Fighter 2: Deadly China Dolls&quot;. 
&quot;Top Fighter 2&quot; is a spectacular look at the female superstars of martial arts cinema. Over 20 of the toughest battling babes are featured, including the legendary Angela Mao, who starred with Bruce Lee in &quot;Enter The Dragon&quot; 

Those who appreciate the &quot;new wave&quot; all-action style can sample the delights of the delicate but deadly Moon Lee, the ballistic showdowns of the stunning Elaine Lui, and Japan&amp;#039;s baddest femme fatale exports Yukari Oshima and Michiko. 

&quot;Top Fighter 2&quot; also features the beautiful and sensual Michelle Yeoh, who has rocketed to international stardom in &quot;Crouching Tiger, Hidden Dragon&quot;. 

